import './Navbar.css';
import React,{useState,useEffect} from 'react';

function Navbar() {
    const [banana,setbanana] = useState("Hay");
    
    const setFunction=()=>{
        setbanana("Ciao");
    }

    useEffect(()=>{
            setFunction();
        },[banana]);

    return (
        <div>{setFunction}</div>
    )
}

export default Navbar
